import React from 'react';
import { Image, Segment } from 'semantic-ui-react';


const ImageOfRolePlayers = () => {
    return (
        <React.Fragment>
            <div style={{ overflow: 'auto', maxHeight: '7vh' }}>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                <Segment><Image inline circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' /></Segment>
                
                
            </div>
        </React.Fragment>
    )
}

export default ImageOfRolePlayers;
